import React from 'react';

class SenderInfo extends React.Component{
    constructor(props){
        super(props);
    }

    render() {
        return (
            <span className="user-info">
               <span className="name"> {this.props.user.first_name} {this.props.user.sur_name}</span>
               <small className="type">{this.props.senderType}</small>
            </span>
        );
    }
}

export default SenderInfo;
